    false,nt"url": null,nt"notes": "NODC Accession 0117677 includes chemical,
    discrete sample, physical and profile data collected from MELVILLE in the Arabian
    Sea, Bay of Bengal, Bering Sea, Gulf of Aden, Indian Ocean, Mediterranean Sea -
    Eastern Basin, Mediterranean Sea - Western Basin, North Atlantic Ocean, North Greenland
    Sea, North Pacific Ocean, Norwegian Sea, Red Sea, South Atlantic Ocean and South
    Pacific Ocean from 1972-07-18 to 1978-04-28 and retrieved during cruise GEOSECS
    Atlantic, GEOSECS Indian and GEOSECS Pacific. These data include DELTA CARBON-14,
    DELTA HELIUM-3, DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), RADIUM ISOTOPES,
    SALINITY, SILICATE, TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope) and WATER
    TEMPERATURE. The instruments used to collect these data include CTD and bottle.
    These data were collected by Gote H. Ostlund of Rosenstiel School of Marine and
    Atmospheric Science and Minze Stuiver of University of Washington as part of the
    GEOSECS Atlantic, GEOSECS Indian and GEOSECS_Pacific data set.",nt"owner_org":
